{projects.map((project, index) => (
  <ProjectCard
    key={project.id}
    title={project.title}
    description={project.description}
    imgSrc={project.imgSrc}
    link={project.link}
    reverse={index % 2 !== 0} // reverses layout on every other card
  />
))}
